import React from 'react';

const Navigation = () => {
    return (
        <nav>
            <ul>
                <li><a href="">Главная</a></li>
                <li><a href="" >Авторизация</a></li>
                <li><a href="">Профиль</a></li>
                <li><a href="inf.html">Информация</a></li>
            </ul>
        </nav>
    )
}

export default Navigation;
